import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import Navbar from './Cmponents/Navigation';
import { MoviesContextProvider } from './Context/MoviesContext'; // Import your MoviesContextProvider

function App() {
  return (
    <div className="App">
      <MoviesContextProvider> {/* Wrap the provider here */}
        <BrowserRouter>
          <Navbar />
          <div className="pages">
            <Routes>
              <Route path="/" element={<Home />} />
            </Routes>
          </div>
        </BrowserRouter>
      </MoviesContextProvider>
    </div>
  );
}

export default App;
